import Swal from "sweetalert2"; // Import SweetAlert2
import { createRegister, LoginAPI } from "../services/LoginServices";
const questionReducer = async (state = [], action) => {
    console.log(state, action);
        switch (action.type) {
        case "DO":
            const question = await LoginAPI(action.id);
            return question;

        default:
            return state;
    }

}
export default questionReducer;
